Cast: Diamond Jackson, Tiffany Tyler

In the premiere volume of The Seduction of Innocence Tiffany Tyler makes her on-screen nude debut as a young woman who is going through some difficult times and is undecided about her future. She confides in Ms Jackson, her career counselor that she just broke up with her boyfriend. Sad and vulnerable, Tiffany is eager to accept advice and compassionate support from Ms. Jackson. From the office they move to a nearby couch and soon find themselves exploring sapphic foreplay. Ms. Jackson is slow and patient, waking up a passion that Tiffany had never experienced. They share a very romantic sexual interlude to celebrate their new found love.
